package com.example.sendfile;

import java.io.DataInputStream;
import java.io.DataOutputStream;
import java.io.IOException;
import java.net.URL;
import java.util.Base64;
import javax.net.ssl.HttpsURLConnection;

public class HttpClient {

  private String getBody() {
    String base =
        "";
    byte[] binary = Base64.getDecoder().decode(base);
    StringBuilder sb = new StringBuilder();
    for (byte b : binary) {
      sb.append(Byte.toString(b));
    }
    return sb.toString();
  }

  public void send() {
    try {
      URL url = new URL(
          "https://services.assureid.net/AssureIDService/Document/1c7dae33-5d1e-48ae-88b0-3cf9a29b9b58/Image?side=0&light=0&metrics=true");

      HttpsURLConnection connection = (HttpsURLConnection) url.openConnection();

      connection.setRequestMethod("POST");

      connection.setRequestProperty("Accept", "application/json, text/plain, */*");
      connection.setRequestProperty("Accept-Encoding", "gzip, deflate, br");
      connection.setRequestProperty("Accept-Language", "en-US,en;q=0.7,ru;q=0.3");
      connection.setRequestProperty("Authorization",
          "Basic ZGF2ZS5ndWlsYmF1bHRAZXF1aWZheC5jb206TXlzTXc4TnV5RVlZVHJnViE=");
      connection.setRequestProperty("Content-Type", "application/x-www-form-urlencoded");
      
      connection.setDoOutput(true);
      connection.setDoInput(true);

      DataOutputStream outputStream = new DataOutputStream(connection.getOutputStream());
      outputStream.writeBytes("image/jpg;" + getBody());
      outputStream.close();
      
      DataInputStream inputStream = new DataInputStream(connection.getInputStream());
      for (int i = inputStream.read(); i != -1; i = inputStream.read()) {
        System.out.print((char) i);
      }
      inputStream.close();
      
      System.out.println(connection.getResponseCode());
      System.out.println(connection.getResponseMessage());
    } catch (IOException e) {
      // TODO Auto-generated catch block
      e.printStackTrace();
    }

  }
}
